		////	'load' 'volatile'? adresstype=Type (types=TypeList)? adress=Value (',' ((ALIGNMENT) | (MetadataValue)+))* |
		//
		////	'load' 'atomic' 'volatile'? adresstype=Type adress=Value(types=TypeList)? 'singlethread'? ordering=ATOMIC_ORDERING (',' 'align'
		//
		////	index=INT)?;
		//
		////
		//
		////	/ *
